import SearchBar from "../Components/SearchBar";
import Swan from "../Components/Swan";
import SwanResult from "../Components/SwanResult";
import "../styles/Main.scss";
import React, { useEffect } from "react";




function Main() {



  return (
    <div className="app">
      <div className="bar">
      {/* <p className="putoshka">Putoshka: Swan Scanner</p> */}
      <p className="putoshka">Обработанные фото</p>

      </div>
      <div className="main">
        <div className="left">
          {/* <p className='title'>Обработанные фото</p> */}
          <SearchBar/>
          <div className="swanDataset">
            <Swan/><Swan/><Swan/><Swan/>
          </div>
        </div>
        <div className="right">
          <SwanResult/>
          <input multiple type="file" className="addSwans" accept="image/*" placeholder="Добавить фотографии"/> 
        </div>
      </div>
    </div>
  );
}

export default Main;
